/* @jsx mdx */
  import React from 'react'
  import { mdx } from '@mdx-js/react'
  /* @jsx mdx */
import { Playground } from 'docz'
import react from 'react';
import { Input, Radio } from 'nowrapper/lib/antd';
import Form, { FormItem, FormCore } from 'noform';
import 'antd/dist/antd.css';
import 'noform/dist/index.css';
import 'nowrapper/dist/antd/index.css';

const makeShortcode = name => function MDXDefaultShortcode(props) {
  console.warn("Component " + name + " was not imported, exported, or provided by MDXProvider as global scope")
  return <div {...props}/>
};

const layoutProps = {

};
const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">

    <h1 {...{
      "id": "了解核心"
    }}>{`了解核心`}</h1>
    <h2 {...{
      "id": "core是什么？"
    }}>{`Core是什么？`}</h2>
    <p><strong parentName="p">{` Core是表单的抽象概念，它包含了表单的所有数据。`}</strong></p>
    <p>{`在NoForm的定义中，表单数据分为 `}<a parentName="p" {...{
        "href": "/form/core/value"
      }}><strong parentName="a">{`值(values)`}</strong></a>{`，`}<a parentName="p" {...{
        "href": "/form/core/index#%E8%8E%B7%E5%8F%96%E4%BF%AE%E6%94%B9%E9%94%99%E8%AF%AF%E4%BF%A1%E6%81%AFerror"
      }}><strong parentName="a">{`状态(status)`}</strong></a>{`，`}<a parentName="p" {...{
        "href": "/form/core/errors"
      }}><strong parentName="a">{`错误(errors)`}</strong></a>{`， `}<a parentName="p" {...{
        "href": "/form/core/props"
      }}><strong parentName="a">{`属性(props)`}</strong></a>{`， 同时它提供了一系列的API去控制这些数据。`}</p>
    <p>{`因此表单就变成两部分，`}<strong parentName="p">{`View 视图层`}</strong>{` 和 `}<strong parentName="p">{`Core 数据层`}</strong>{`，View视图层对逻辑无感知，仅仅单纯显示 Core 的数据。 因此通过对Core的操作就能完成视图的变更。`}</p>
    <img width="600px" src="https://img.alicdn.com/tfs/TB1mz_malCw3KVjSZR0XXbcUpXa-1344-664.png" alt="core-form示意图" />
    <h2 {...{
      "id": "如何使用"
    }}>{`如何使用`}</h2>
    <p>{`引入方式`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-jsx"
      }}>{`import Form, { FormCore } from 'noform';
`}</code></pre>
    <p>{`定义表单之前需要先定义核心，初始话核心有以下两种方式：`}</p>
    <ol>
      <li parentName="ol">{`外部传入： 通过 `}<inlineCode parentName="li">{`new FormCore()`}</inlineCode>{` 构建新的表单核心 【推荐】`}</li>
    </ol>
    <pre><code parentName="pre" {...{
        "className": "language-jsx"
      }}>{`const core = new FormCore();
return <Form core={core}>
    ...
</Form>
`}</code></pre>
    <ol {...{
      "start": 2
    }}>
      <li parentName="ol">{`内置生成: 通过 `}<inlineCode parentName="li">{`onMount`}</inlineCode>{`获取内置构建的核心`}</li>
    </ol>
    <pre><code parentName="pre" {...{
        "className": "language-jsx"
      }}>{`const onMount = (core) => {}
return <Form onMount={onMount}>
    ...
</Form>
`}</code></pre>
    <ol {...{
      "start": 2
    }}>
      <li parentName="ol">{`设置方法`}</li>
    </ol>
    <pre><code parentName="pre" {...{
        "className": "language-jsx"
      }}>{`const core = new FormCore();
core.onChange = (fireKeys, values, ctx) => {
    // 同上所述
}
`}</code></pre>
    <h2 {...{
      "id": "构建参数"
    }}>{`构建参数`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-jsx"
      }}>{`const core = new FormCore({ // 参数列表
    ...params
})
`}</code></pre>
    <table>
      <thead parentName="table">
        <tr parentName="thead">
          <th parentName="tr" {...{
            "align": null
          }}>{`参数名`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`作用`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`类型`}</th>
          <th parentName="tr" {...{
            "align": null
          }}>{`默认值`}</th>
        </tr>
      </thead>
      <tbody parentName="table">
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`values`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`初始值集合`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`对象`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`{}`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`status`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`初始状态集合`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`对象`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`{}`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`errors`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`初始错误信息集合`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`对象`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`{}`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`props`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`初始props集合`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`对象`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`{}`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`globalStatus`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`初始全局状态`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`ENUM `}{`['edit', 'preview', 'disabled']`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`'edit'`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`validateConfig`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`校验规则`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`参考`}<a parentName="td" {...{
              "href": "/form/core/validate"
            }}>{`校验`}</a>{`一节， 规则与`}<a parentName="td" {...{
              "href": "https://github.com/yiminghe/async-validator"
            }}>{`async-validator`}</a>{`一致`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`{}`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`onChange`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`监听值变更`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`方法(firekeys, values, core)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`noop`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`onBlur`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`监听焦点变更`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`方法(key)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`noop`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`onFocus`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`监听焦点变更`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`方法(key)`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`noop`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`onEvent`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`监听以上三种事件`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`方法(paylaod: { fireKey, fn, args })`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`noop`}</td>
        </tr>
        <tr parentName="tbody">
          <td parentName="tr" {...{
            "align": null
          }}>{`interceptor`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`拦截器`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`参考`}<a parentName="td" {...{
              "href": "/form/core/interceptor"
            }}>{`拦截器`}</a>{`一节`}</td>
          <td parentName="tr" {...{
            "align": null
          }}>{`{}`}</td>
        </tr>
      </tbody>
    </table>
    <h2 {...{
      "id": "api"
    }}>{`API`}</h2>
    <h2 {...{
      "id": "监听变更"
    }}>{`监听变更`}</h2>
    <p>{`核心监听有以下两种方式：`}</p>
    <ol>
      <li parentName="ol">{`构建函数传入【推荐】`}</li>
    </ol>
    <pre><code parentName="pre" {...{
        "className": "language-jsx"
      }}>{`const core = new FormCore({
    onChange: (fireKeys, values, ctx) => {
        // fireKeys 是此次发生变更字段，数组类型
        // values 是发生变化后的所有表单的值集合
        // ctx 是核心实例
    }
});
`}</code></pre>
    <h2 {...{
      "id": "获取修改值values"
    }}>{`获取/修改值(values)`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-jsx"
      }}>{`core.getValues(); // 获取整体表单的值
core.getItemValue('username'); // 获取单字段值
core.setValues({ username: 'bobby' }); // 设置整体表单的值
core.setItemValue('username', 'bobby'); // 设置单字段的值
`}</code></pre>
    <h2 {...{
      "id": "获取修改状态status"
    }}>{`获取/修改状态(status)`}</h2>
    <pre><code parentName="pre" {...{
        "className": "language-jsx"
      }}>{`core.getStatus(); // 获取整体表单的状态
core.getItemStatus('username'); // 获取单字段状态
core.setStatus({ username: 'preview' }); // 设置整体表单的状态
core.setItemStatus('username', 'disabled'); // 设置单字段的状态
core.getGlobalStatus(); // 获取全局状态
core.setGlobalStatus('edit'); // 设置全局状态
`}</code></pre>
    <h2 {...{
      "id": "获取修改属性信息props"
    }}>{`获取/修改属性信息(props)`}</h2>
    <p><strong parentName="p">{`FormItem`}</strong>{` 属性保留字为： `}<inlineCode parentName="p">{`label`}</inlineCode>{`, `}<inlineCode parentName="p">{`prefix`}</inlineCode>{`, `}<inlineCode parentName="p">{`suffix`}</inlineCode>{`, `}<inlineCode parentName="p">{`help`}</inlineCode>{`, `}<inlineCode parentName="p">{`hint`}</inlineCode>{`, `}<inlineCode parentName="p">{`top`}</inlineCode>{`, `}<inlineCode parentName="p">{`required`}</inlineCode>{`。`}</p>
    <p>{`当设置这些值的时候，会影响 `}<strong parentName="p">{`FormItem`}</strong>{`, 除此之外会影响真实的表单组件。`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-jsx"
      }}>{`core.getItemProps('username');
core.setItemProps('username', {
    dataSource: [
        { label: 'bobby', value: 'bobby'},
        { label: 'leslie', value: 'leslie'}
    ]
});
`}</code></pre>
    <blockquote>
      <p parentName="blockquote"><inlineCode parentName="p">{`setProps`}</inlineCode>{` 常见场景是替换类似 `}<strong parentName="p">{`Select`}</strong>{` 组件的`}<inlineCode parentName="p">{`dataSource`}</inlineCode>{`，并且不会像`}<inlineCode parentName="p">{`setState`}</inlineCode>{`引起全局的渲染。`}</p>
      <p parentName="blockquote"><inlineCode parentName="p">{`NoForm`}</inlineCode>{` 的治理思想是 state 和 core 不混用，表单页面仅仅使用core来控制，避免不必要的渲染。`}</p>
    </blockquote>
    <h2 {...{
      "id": "获取修改错误信息error"
    }}>{`获取/修改错误信息(error)`}</h2>
    <p>{`错误信息的默认值和空值为null`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-jsx"
      }}>{`core.getError(); // 获取整体表单的错误信息
core.getItemError('username'); // 获取单字段错误信息
core.setError({ username: 'username is required' }); // 设置整体表单的错误信息
core.setItemError('username', 'username is required'); // 设置单字段的错误信息
`}</code></pre>
    <p>{`注：`}<inlineCode parentName="p">{`setError`}</inlineCode>{` 是实现校验的底层的方法，校验会自动调用，开发者尽可能不需要使用它，除非知道自己在做什么。`}</p>
    </MDXLayout>;
}

MDXContent.isMDXComponent = true;
